import React from "react";
import Link from "next/link";
import { Container } from "react-bootstrap";
//Components
import Navbar from "./Navbar/Navbar";

const Layout: React.FC = ({ children }) => {
  return (
    <>
      <Container fluid="lg">
        <Navbar />
        {children}
      </Container>
    </>
  );
};

export default Layout;
